      solution: 'None of the above'
    }, { question: "Best game in the world?",
    answers: ['Apex Legends', 'Battlefield V', 'PUBG', 'CSGO', 'None of the above'],
    solution: 'CSGO'
  }, {
    question: "How weak is Salman?",
